import React from 'react';

function TimerContainer() {
  return (
    <div className="timer-container">
      <h2>Греча</h2>
      <div className="timer-container__timers">
        <div className="timer-container__timers--total"></div>
        <div className="timer-container__timers--stir"></div>
      </div>
    </div>
  );
}

export default TimerContainer;
